selector_to_html = {"a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Configuraci\u00f3n del Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#bluetooth-ble\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth BLE<a class=\"headerlink\" href=\"#bluetooth-ble\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html#bluetooth-keyboard-transmission-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidad de transmisi\u00f3n del teclado Bluetooth<a class=\"headerlink\" href=\"#bluetooth-keyboard-transmission-speed\" title=\"Link to this heading\">#</a></h2><h3>Alta velocidad<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de trabajo<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>En el \u00e1rea de trabajo fuera del rango de los 2. G receptor o se\u00f1al Bluetooth, puede activar el modo de almacenamiento del esc\u00e1ner siguiendo los pasos descritos a continuaci\u00f3n. En este modo, todos los datos escaneados ser\u00e1n almacenados directamente en el esc\u00e1ner. Antes de subir los datos se guardar\u00e1 permanentemente en el esc\u00e1ner para que puedas subir los datos cuando el esc\u00e1ner est\u00e9 en el rango de se\u00f1al que recibe.</p>", "a[href=\"#wx-bt-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gu\u00eda de configuraci\u00f3n r\u00e1pida del esc\u00e1ner inal\u00e1mbrico <strong>WX-BT</strong><a class=\"headerlink\" href=\"#wx-bt-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes de volumen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Escanea el c\u00f3digo de configuraci\u00f3n correspondiente para activar o desactivar el indicador de sonido del esc\u00e1ner</p>", "a[href=\"bluetooth.html#modify-bluetooth-name\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modificar nombre Bluetooth<a class=\"headerlink\" href=\"#modify-bluetooth-name\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Editando datos<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Formato de salida<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Para cambiar el formato de transmisi\u00f3n de datos de escaneo, escanee uno de los ocho c\u00f3digos de barras correspondientes al formato deseado.</p>", "a[href=\"bluetooth.html#ios-popup-hide-keyboard\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">IOS Popup/Ocultar Teclado<a class=\"headerlink\" href=\"#ios-popup-hide-keyboard\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo Bluetooth<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1><h2>HID Bluetooth<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"bluetooth.html#bluetooth-hid\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">HID Bluetooth<a class=\"headerlink\" href=\"#bluetooth-hid\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Obtener idioma actual del teclado<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de almacenamiento<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Carga de datos<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ocultar Set<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Ocultar caracteres de inicio de c\u00f3digo de barras<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n del Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ap\u00e9ndice<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>C\u00f3digos num\u00e9ricos<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>A\u00f1adir Sufijo<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato de salida<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Para cambiar el formato de transmisi\u00f3n de datos de escaneo, escanee uno de los ocho c\u00f3digos de barras correspondientes al formato deseado.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informaci\u00f3n de la bater\u00eda<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener versi\u00f3n de Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n r\u00e1pida<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>A\u00f1adir prefijo<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html#clear-pairing-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Borrar informaci\u00f3n de emparejamiento<a class=\"headerlink\" href=\"#clear-pairing-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefijo<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>A\u00f1adir prefijo<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tiempo de sue\u00f1o<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Escaneando el siguiente c\u00f3digo de configuraci\u00f3n, puede establecer el esc\u00e1ner para entrar en modo de sue\u00f1o despu\u00e9s de un cierto per\u00edodo de tiempo en el que no se escanea ning\u00fan c\u00f3digo, para reducir el consumo de energ\u00eda.</p>", "a[href=\"bluetooth.html#bluetooth-spp\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth SPP<a class=\"headerlink\" href=\"#bluetooth-spp\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
